  \"2015-12-20T18:58:40.238951\",\n\t\"name\": \"1999-nantou-taiwan-images\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"At least 2,297 people killed, 8,700 injured,
  600,000 people left homeless and about 82,000 housing units damaged by the earthquake
  and larger aftershocks. Damage estimated at 14 billion U.S. dollars. Maximum intensity
  (VI JMA) in Nan-touand Tai-chung Counties. Half of a village was lost by subsidence
  into the Ta-an Hsi and landslides blocked the Ching-shui Hsi, creating a large lake.
  Two other lakes were created by substantial ground deformation near the epicenter.
  Surface faulting occurred along 75 km of the Chelungpu Fault. Felt (V JMA) at Chia-i
  and I-lan; (IV JMA) at Kao-hsiung, Taipei and Tai-tung; (IV JMA) on Lan Yu and Peng-hu
  Tao; (III JMA) at Hua-lien. Felt strongly in Fujian, Guangdong and Zhejiang Provinces.
  Felt (IV) in Hong Kong. Also felt (II JMA) on Iriomote-jima and Yonaguni- jima;
  (I JMA) on Ishigaki-jima and Miyako-jima, Ryukyu Islands.\",\n\t\"license_title\":
